import React from 'react';
import {
  Doors, HeightAndWidth, NextButton, Windows,
} from './index';

function FirstForms() {
  const handleClick = () => {
    console.log('click');
  };

  const obj = { handleClick }
  return (
    <form>
      <HeightAndWidth />
      <Windows />
      <Doors />
      <NextButton info={ obj } />
    </form>
  );
}

export default FirstForms;
